import React from 'react';
import './Deploying.css'

function Deploying() {
    return (
      <div className="row section" style={{paddingBottom: "100px"}}>
          <div className="two-col-format-column" style={{paddingLeft: "10vw"}}>
              <div class="deploy-button">
                  <span>DEPLOY</span>
              </div>
          </div>
          <div className="two-col-format-column" style={{paddingRight: "10vw"}}>
              <p>
                  The website was then deployed.
              </p>
          </div>
      </div>
    );
}

export default Deploying;
